import React, { Component } from "react";


export default class PresentesAdmin extends Component {

  render() {
    return (
      <div className="wrap-content">

          <div className="content-title">
              <div className="flex flex-baseline flex-space">
                  <div>
                      <h1>Presentes</h1>
                      <h2>Edite, exclua ou crie novos presentes</h2>
                  </div>

                  <div>
                      <button className="gradient fullcolor novo-desk">Novo presente</button>
                      <button className="gradient fullcolor novo-mob">+</button>
                  </div>
              </div>
          </div>

      </div>
    );
  }
}
